// import {useEffect, useState} from 'react'; 
import logo from '../logo.svg';
import {motion} from "framer-motion";

function Left(){
    return (
        <div className='bg-red-400'>
            <img src={logo} alt="Logo" className="w-40 h-10"/>
        </div>
    )
}

function Right(){
    return (
        <div className='w-[60%] border-4 p-2'>
            <span>Home</span>
        </div>
    )
}

function Navbar(){
    return (
        <motion.div transition={{duration:1.5}} className="sticky top-0 left-0 right-0 bg-white flex justify-center items-center border-4 p-2 z-40">
            <div className="w-[50%] flex justify-center space-x-2 border-4 rounded-full p-2 ">
                <Left />
                <Right />
            </div>
        </motion.div>
    )
}

export default Navbar;
